import React from 'react'; 
// import TableRow from '@material-ui/core/TableRow';
// import TableCell from '@material-ui/core/TableCell';


class TicketListTable extends React.Component{
    render(){
        return(
            <tr>
                <td>{this.props.name}</td>
                <td>{this.props.user_id}</td>
                <td>{this.props.ticketing_id}</td>
                <td>{this.props.phone}</td>
                <td>{this.props.show_title}</td>
                <td>{this.props.show_time}</td>
                <td>{this.props.keys}</td>
                <td>{this.props.ticketing_date}</td>
            </tr>
        )
    }
}
export default TicketListTable;
